g2:c.PROCEDURE.g2:a.TEXT:
_dxi-demo-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- For devstuff development environment } 
  if the item named by devstuffName exists and _dxi_demo-internals is not a member of the item-list named by devstuffName then
    insert _dxi_demo-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists and _dxi_demo-internals is not a member of the item-list named by intstuffName then
    insert _dxi_demo-internals at the end of the item-list named by intstuffName;

  conclude that grtl-load-completed = true;

  {--- No startup required for module restart }
{
  if not(InitialStartup) then return;
} 

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
